import React, { useEffect, useState } from "react";
import { Card, Button, Container, Col,Row } from "react-bootstrap";
import "./Css/DaftarPasien.css";

export const DaftarPasien = () => {
  const [data, setData] = useState([]);
  let token = JSON.parse(localStorage.getItem("dokter-info"));

  const getData = async () => {
    try {
      let response = await fetch(
        "http://localhost:8080/api/test/dokter/daftarpasien",
        {
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'Authorization': `Bearer ${token[0]}`,
          },
        }
      );
      response = await response.json();
      setData(response);
    } catch (e) {
      console.log(e.message);
    }
  };

  useEffect(() => {
    getData();
  }, []);
  let no = 1;

  return (
    <div className="daftarpasien-container">
      {data.map((item) => (
        <Col>
          <Card>
            <Card.Header>Pasien {no++}</Card.Header>
            <Card.Body>
              <Card.Text>
                Nama : {item.nama}
                Umur : {item.umur}
                Jenis Kelamin : {item.jeniskelamin}
                Gol Darah : {item.golongandarah}
                Gejala : {item.gejala}
              </Card.Text>
              <Button variant="primary" href="/dokter/treatment">
                Treat
              </Button>
            </Card.Body>
          </Card>
        </Col>
      ))}
    </div>
  );
};
